        var ax = this.fig.axes[0];

            .attr("dx", "-.8em")
            .attr("dy", ".15em")
            .attr("font-family", "sans-serif")
            .attr("font-size", "10pt")
            .attr("transform", function(d) {
                return "rotate(-65)" 
                });
 
    }
